import React, { Component } from 'react'

class Train extends Component {
    constructor(){
        super()
        this.state={
            orders:[
                {
                    orderID: 12,
                    name: "Aishh",
                    status: "Not Delivered",
                    TID: '#2343'
                },
                {
                    orderID: 123,
                    name: "Sandu",
                    status: "Delivered",
                    TID: '#1243'
                },
                {
                    orderID: 23,
                    name: "Ann",
                    status: "Not Delivered",
                    TID: '#123'
                },
            ]
        }
    

    }
    render() {
        return (
            <div id="main-content">
                <h5> Available Trains: </h5>

                    <table className="table table-bordered table-xs-responsive table-hover">
                        <thead className="thead-dark">  
                        <tr>
                            <th>Train No</th>
                            <th>Train Name</th>
                            <th>Time of Dep.</th>
                            <th>Time of Arrival</th>
                            <th>Price</th>
                            <th>No.of</th>


                        </tr>
                        </thead>
                        <tbody>
                        {
                             this.state.orders.map((item) => (
                                <tr key={item.orderID}>
                                    <td>{item.orderID}</td>
                                    <td>{item.name}</td>
                                    <td>{item.status}</td>
                                    <td>{item.TID}</td>
                                </tr>
                            ))
                        }
                            
                        </tbody>
                    </table>
                </div>
        )
    }
}

    

export default Train
